window.bookSummaryJSON = "<p>Raven Black's wedding is on a collision course with disaster. A bonus novella in the USA Today bestselling Crossbreed series!</p> <p>Keystone's planning an unforgettable wedding, but there's only one problem: the groom is missing. To top that off, the father of the bride is out of town, leaving Raven to wonder if destiny has screwed her over once again. Despite the setbacks, she's full steam ahead-even if that means showing up at the altar alone.</p> <p>Hilarious antics ensue as listeners catch up with their favorite characters. A high-octane chase, a tattoo gone wrong, and a stunning surprise. Will Christian pledge his eternal love, or has the twice-burned Vampire gotten cold feet?</p> <p>The series ending you've been waiting for.</p>"; 
